import React, {useState} from 'react'
import sf_housing_data from '../assets/mocks/sf_housing_data.json'
import sf_housing_data_full from '../assets/mocks/sf_housing_data_full.json'

export default function table() {


    // let price = house.price;
    // let imgSrc = house.imgSrc;
    // let latitude = house.latLong.latitude;
    // let longtitude = house.latLong.longitude;
    // let id, title, statusType, beds, baths, area, streetAddress, city, state, zip, location;

    const tableHeaders = [
        { name: "No#", field: "id", sortable: false },
        { name: "Title", field: "title", sortable: false },
        { name: "Price", field: "price", sortable: true },
        { name: "Beds", field: "beds", sortable: false },
        { name: "Baths", field: "baths", sortable: false },
        { name: "Location", field: "location", sortable: false }
    ];

    console.log(sf_housing_data.length);
    console.log(sf_housing_data_full.length);


    const [tableItems, setTableItems] = useState([]);




    return (
        <table>
            <thead>
                <tr>
                    {  
                        tableHeaders.map( head => (
                            <th key={head.field}>
                                {head.name}
                            </th>
                        ))
                    }
                </tr>
            </thead>
            <tbody>

                    {
                        sf_housing_data.map ( house => (
                        <tr key={house.zpid? house.zpid : house.buildingId}>
                            <td>
                                {house.zpid? house.zpid : house.buildingId}
                            </td>
                            <td>
                            {/* { name: "No#", field: "id", sortable: false },
        { name: "Title", field: "title", sortable: false },
        { name: "Price", field: "price", sortable: true },
        { name: "Beds", field: "beds", sortable: false },
        { name: "Baths", field: "baths", sortable: false },
        { name: "Location", field: "location", sortable: false } */}
                            </td>
                            <td>
                                {house.zpid? house.hdpData.homeInfo.streetAddress : house.statusText}
                            </td>
                            <td>
                                {house.price}
                            </td>
                        </tr>
                        ) )
                    }
            </tbody>
        </table>
    )
}
